function Footer() {
  return (
    <footer className="page-footer blue darken-1">
      <div className="footer-copyright blue darken-2">
        <div className="container white-text">
          © {new Date().getFullYear()} Олександр Івков
          <a className="white-text right" href="https://t.me/https://t.me/J_a_k_e_l">Telegram</a>
          <a className="white-text right" href="https://github.com/SashaIvkov">GitHub</a>
          <a className="white-text right" href="https://www.instagram.com/_s_a_n_y_o_k_2.0?igsh=MWs3bHk2NGwwb255cw%3D%3D&utm_source=qr">Github</a>
        </div>
      </div>
    </footer>
  );
}

export { Footer };
